import "./Resources.scss";

const Resources = () => {
  return (
    <div className="main mt-3">
      <h4>Full stack:</h4>

      <h4>Front-end:</h4>

      <h4>Back-end</h4>

      <h4>Developer Operations (Devops)</h4>

      <h4>Networks</h4>

      <h4>Database</h4>

      <h4>Machine Learning</h4>
    </div>
  );
};

export default Resources;
